class Facebook extends React.Component {

    constructor(props) {
        super(props);
        this.state = {
            isFBLoggedIn : false,
            userID:'',
            name:'',
            email:'',
            picture:'',
            allpages:''
        };

        // This binding is necessary to make `this` work in the callback
        this.logoutFacebook = this.logoutFacebook.bind(this);
    }

    render() {
        return <h2>Hi, I am a Car!</h2>;
    }
}


export default Facebook;
